{
    "schemes": [],
    "swagger": "2.0",
    "info": {
        "description": "Recipe management API with AI-powered extraction, pantry tracking, and shopping lists",
        "title": "DishFlow API",
        "termsOfService": "https://dishflow.app/terms",
        "contact": {
            "name": "DishFlow Support",
            "email": "support@dishflow.app"
        },
        "license": {
            "name": "MIT",
            "url": "https://opensource.org/licenses/MIT"
        },
        "version": "1.0"
    },
    "host": "api.dishflow.app",
    "basePath": "/api/v1",
    "paths": {
        "/auth/anonymous": {
            "post": {
                "description": "Create or retrieve an anonymous user account using device ID",
                "consumes": [
                    "application/json"
                ],
                "produces": [
                    "application/json"
                ],
                "tags": [
                    "Auth"
                ],
                "summary": "Anonymous authentication",
                "parameters": [
                    {
                        "description": "Device ID (optional)",
                        "name": "request",
                        "in": "body",
                        "schema": {
                            "$ref": "#/definitions/internal_handler.SwaggerAnonymousRequest"
                        }
                    }
                ],
                "responses": {
                    "200": {
                        "description": "Authentication successful",
                        "schema": {
                            "$ref": "#/definitions/internal_handler.SwaggerAnonymousResponse"
                        }
                    },
                    "500": {
                        "description": "Internal server error",
                        "schema": {
                            "$ref": "#/definitions/internal_handler.SwaggerErrorResponse"
                        }
                    }
                }
            }
